New York City Mayor Eric Adams announced the city has begun demolishing outdoor dining sheds that popped up during the pandemic but are no longer being used and causing quality-of-life problems. An "initial blitz” identified 24 dormant sheds outside now-closed restaurants which are being removed.

“I want to say it loud and clear: Outdoor dining is here to stay,” Mr. Adams said, while urging New Yorkers to report abandoned outdoor dining sheds or those out of compliance.
